import React from "react";
import "./contact.scss";

function Contact() {
  return (
    <div className="contact" id="contact">
      <div className="left">
        <img src="src/img/backdrop.png" alt="" />
      </div>
      <div className="right">
        <h2>Contact</h2>
      </div>
    </div>
  );
}

export default Contact;
